import React, { Component } from "react";

class ProfileHeader extends Component {
  render() {
    const { handle } = this.props.handle;
    return (
      <div className="text-center mb-4">
        <h4>{handle}'s Profile</h4>
      </div>
    );
  }
}
export default ProfileHeader;
